import React from 'react'
import * as S from './styles'
import logo from '../../assets/logo.png'

function SignIn(){
    return(
        <S.Container>
            <img src={logo} alt='logo' />
            <input id="email" type="text" />
            <input id="password" type="text" />
        </S.Container>

    )
}

export default SignIn
